function ConnectionPage() {
    const names = ['name1', 'name2', 'name3'];
    return (
        <div>
            <div>
                <div></div>
                    {names.map((n, index) => 
                    <div key={index}>{n}</div>
                    )}
            </div>
        </div>
    );
}
export default ConnectionPage;
